 // Check if linkData exists and is an array
 if (!Array.isArray(links)) {
  console.error("Invalid data format for pressLinks. Expected an array.");
  return null; // Return null if linkData is invalid
}

return (
  <div className="links-content">
    {linkData.map((linkItem, index) => (
      <React.Fragment key={index}>
        <a 
          href={linkItem.link} 
          target="_blank" 
          rel="noopener noreferrer"
        >
          {linkItem.title}
        </a>
        {index < linkData.length - 1 && ', '}
      </React.Fragment>
    ))}
  </div>
);
};

DisplayLinksInline.propTypes = {
linkData: PropTypes.arrayOf(
  PropTypes.shape({
    link: PropTypes.string.isRequired,
    title: PropTypes.string.isRequired,
  })
).isRequired,
};

export default  DisplayLinks;
